import "./index.css";

function Header() {
  return (
    <div className="header">
      <span className="hit">【必读】➡️ &nbsp;</span>
      <a
        href="https://mp.weixin.qq.com/s?__biz=MzUyMjkwNTgwOA==&mid=2247485923&idx=1&sn=0710d33fd1e1287e10f88bd4139e0a0e&chksm=f9c5f85cceb2714a585567f21751ae703f8ba80519a7a089746079a05c4f916c962fe81332d1#rd"
        target="_blank"
        rel="noreferrer"
      >
        返现红包详细规则
      </a>
    </div>
  );
}

export default Header;
